import styled from 'styled-components';

export const BodyHomeBody = styled.body`
    width:1280px;
    height:720px;
    margin:auto;
    z-index : 1;
`;

export const PageBody = styled.div`
    background-color: rgb(255,255,255);
`;

export const Titre2 = styled.h1`
    color: rgb(0, 0, 0);
    z-index : 1;
    text-align: center;
    font-weight: bold;
    font-size: 24;
    padding: 1cm;
`;
export const Carte = styled.div`
    id:"map";
    width: 50%; 
    height: 530px;
`;
